import React, { useState, useEffect, useRef } from "react";
import "./career.css";
import Header2 from "../components/Header2";

export default function AboutUs() {
  const [activeFAQ, setActiveFAQ] = useState(null);
  const toggleFAQ = (index) => {
    setActiveFAQ(activeFAQ === index ? null : index);
  };

  /* Intersection Observer */
  const sectionsRef = useRef([]);

  useEffect(() => {
    const observer = new IntersectionObserver(
      (entries) => {
        entries.forEach((entry) => {
          if (entry.isIntersecting) entry.target.classList.add("show");
        });
      },
      { threshold: 0.2 }
    );

    sectionsRef.current.forEach((el) => {
      if (el) observer.observe(el);
    });
  }, []);

  const addToRefs = (el) => {
    if (el && !sectionsRef.current.includes(el)) {
      sectionsRef.current.push(el);
    }
  };

  const faqs = [
    {
      question: "Why do we always listen to customers?",
      answer:
        "Listening to sellers and buyers helps us deeply understand their needs.",
    },
    {
      question: "Why do we move uncomfortably fast?",
      answer:
        "We move fast because serving our community in the moment matters.",
    },
    {
      question: "What does prioritizing impact ruthlessly mean?",
      answer: "We focus only on high-impact work that drives seller growth.",
    },
    {
      question: "What does owning everything and nothing mean?",
      answer:
        "We fully own tasks but collaborate openly without ego.",
    },
    {
      question: "Why do we set unreasonably high goals?",
      answer: "Ambitious goals push us to achieve extraordinary results.",
    },
    {
      question: "Why do we provide extreme transparency?",
      answer:
        "Transparency helps every team member perform at their best.",
    },
    {
      question: "What does optimizing for upside mean?",
      answer:
        "We take calculated risks to unlock new possibilities.",
    },
    {
      question: "Why is team over ego important?",
      answer:
        "We succeed by helping each other win.",
    },
    {
      question: "What does 'figure it out' mean at WhatNew?",
      answer:
        "We solve new challenges with creativity and speed.",
    },
    {
      question: "Why do we focus on deeply understanding why?",
      answer:
        "Clarity of purpose ensures meaningful and correct work.",
    },
    {
      question: "Why do we believe in having fun and being kind?",
      answer:
        "Positivity and kindness help us grow together.",
    },
  ];

  return (
    <div>
      <Header2 />

      {/* HERO */}
      <div ref={addToRefs} className="myDiv fade-in">
        <h2>Building the future of commerce, together</h2>
      </div>

      {/* MISSION */}
      <section ref={addToRefs} className="wn-mission fade-in">
        <div className="wn-container">
          <h1 className="wn-title">Our Mission</h1>
          <p className="wn-text">
            Enable anyone to turn their passion into a business.
          </p>
        </div>

        {/* STATS */}
        <section className="wn-stats">
          <div className="wn-stats-inner">
            <div className="wn-cards">
              <article ref={addToRefs} className="wn-card fade-up">
                <div className="wn-card-value">
                  ₹3<span className="wn-card-suffix">B</span>
                </div>
                <h3 className="wn-card-title">Livestream sales</h3>
                <p className="wn-card-meta">Surpassed ₹3B in 2024</p>
              </article>

              <article ref={addToRefs} className="wn-card fade-up">
                <div className="wn-card-value">
                  175,000<span className="wn-card-suffix"> hrs/wk</span>
                </div>
                <h3 className="wn-card-title">Weekly hours</h3>
                <p className="wn-card-meta">Hosted weekly</p>
              </article>

              <article ref={addToRefs} className="wn-card fade-up">
                <div className="wn-card-value">
                  ₹1<span className="wn-card-suffix">M</span>
                </div>
                <h3 className="wn-card-title">Seller earnings</h3>
                <p className="wn-card-meta">Top 500 sellers a year</p>
              </article>
            </div>
          </div>
        </section>
      </section>

      {/* COMMUNITY */}
      <section ref={addToRefs} className="wn-community fade-in">
        <div className="wn-community-container">
          <div className="wn-left">
            <h2 className="wn-heading">
              What drives our mission? <span>Our community.</span>
            </h2>
            <p className="wn-desc">
              WhatNew is built for people who love to buy, sell, and connect.
            </p>
          </div>

          <div className="wn-right fade-up" ref={addToRefs}>
            <img src="/assets/Group839.png" alt="Community" />
          </div>
        </div>
      </section>

      {/* FUTURE COMMERCE */}
      <section ref={addToRefs} className="wn-future-commerce fade-in">
        <div className="wn-fc-container">
          <div className="wn-fc-left">
            <h2 className="wn-fc-heading">Defining the future of commerce</h2>
            <p className="wn-fc-desc">We move boldly and build fast.</p>
            <button className="wn-fc-button">Learn Work About Here</button>
          </div>

          <div className="wn-fc-right fade-up" ref={addToRefs}>
            <img src="/assets/group0.jpg" alt="Team" />
          </div>
        </div>
      </section>

      {/* FAQ */}
      <div ref={addToRefs} className="faq1-container fade-in">
        <h2>Frequently Asked Questions</h2>

        <div className="faq1-grid">
          {faqs.map((faq, index) => (
            <div
              key={index}
              ref={addToRefs}
              className={`faq1-item fade-up ${activeFAQ === index ? "active" : ""}`}
              onClick={() => toggleFAQ(index)}
            >
              <div className="faq1-question">
                <h3>{faq.question}</h3>
                <span>{activeFAQ === index ? "−" : "+"}</span>
              </div>

              {activeFAQ === index && (
                <div className="faq-answer">
                  <p>{faq.answer}</p>
                </div>
              )}
            </div>
          ))}
        </div>
      </div>

      {/* QUOTE BLOCK */}
      <div ref={addToRefs} className="quote-block fade-in">
        <div className="quote-media fade-up">
          <img src="assets/cook.jpeg" alt="Courtney Cook" />
        </div>
        <div className="quote-content">
          <blockquote>
            “Team over ego is the strongest value in our culture.”
          </blockquote>
          <p className="quote-author">
            — <strong>Courtney Cook</strong>, VP, Commerce
          </p>
        </div>
      </div>

      {/* INTERVIEW PROCESS */}
      <div ref={addToRefs} className="cont fade-in">
        <h2>Our Interview Process</h2>
        <div className="grid-container">
          {[
            "Resume Review",
            "Initial Screen",
            "Second Round",
            "Skills Interview",
            "Final Round",
            "Offer Letter",
          ].map((title, i) => (
            <div key={i} ref={addToRefs} className="grid fade-up">
              <h2>{title}</h2>
              <p>Process description for {title}.</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}
